const WorkoutDetails = ({workout}) => {
    return (
        <div className="workout-details">
            <h4> {workout.name}</h4>
            <p><strong>HP: </strong>{workout.hp}</p>
            <p><strong>CP: </strong>{workout.cp}</p>
            <p>{workout.created}</p>
            <p><small>{formatDate(workout.created)}</small></p>
           
        </div>
    )
}

